import React from 'react';

const ImageViewer = ({ ImageSrc }) => {
    return (
        <div className="row">
            <div className="two wide column">
                <i style={{
                    zIndex: "2",
                    position: "fixed",

                    top: "5%",
                    bottom: "5%",

                    left: "5%",
                    right: "5%"
                }} className="caret square left icon"></i>
            </div>
            <div className="twelve wide column">
                <img src="https://upload.wikimedia.org/wikipedia/commons/6/65/Jimmy_Wales_September_2015.jpg" />
            </div>
            <div className="two wide column">
                <i className="caret square right icon"></i>
            </div>
        </div>

    )
}

export default ImageViewer;
